I'm not sure if you can write a chrome extension that takes screenshots of a webpage and saves them to a local directory. Chrome extensions are sandboxed and do not have access to the local file system for security reasons. However, you can use the `chrome.tabs.captureVisibleTab` API to take a screenshot of the current tab and then save it to a temporary file.

Here's an example of how you can do this:

1. Create a new directory for your extension and inside it, create a `manifest.json` file with the following content:

```json
{
  "manifest_version": 2,
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes a screenshot of the current tab and saves it to a temporary file.",
  "permissions": ["activeTab", "downloads"],
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  }
}
```

2. Create a `popup.html` file with the following content:

```html
<!DOCTYPE html>
<html>
  <head>
    <script src="popup.js"></script>
  </head>
  <body>
    <button id="takeScreenshot">Take Screenshot</button>
  </body>
</html>
```

3. Create a `popup.js` file with the following content:

```javascript
document.getElementById('takeScreenshot').addEventListener('click', () => {
  chrome.tabs.query({ active: true, currentWindow: true }, (tabs) => {
    chrome.tabs.captureVisibleTab(null, {}, (imageUrl) => {
      const link = document.createElement('a');
      link.download = 'screenshot.png';
      link.href = imageUrl;
      link.click();
    });
  });
});
```

4. Create an `icon.png` file (128x128 pixels) in the extension directory.

5. Load your extension into Chrome by opening the `Extensions` page (`chrome://extensions`), enabling `Developer mode`, and clicking the `Load unpacked` button to select your extension directory.

Now, when you click the extension's icon in the toolbar, a popup will appear with a "Take Screenshot" button. Clicking this button will take a screenshot of the current tab and trigger a download of the image. The image will be saved to a temporary file in the user's `Downloads` directory.

